def minimum_jumps_to_reach(x: int) -> int:
    """"""
    from math import sqrt

    def find_closest(a):
        a1 = 1
        b1 = 1
        c1 = -1 * 2 * a
        d = b1 ** 2 - 4 * a1 * c1
        x = (-1 * b1 + sqrt(d)) / 2
        if x - int(x) == 0:
            return [x]
        return [int(x), int(x + 1)]
    l = int(find_closest(x)[0])
    s = sum(list(range(l + 1)))
    if x == s:
        return l
    else:
        return l + 1 + (x - (s + l + 1) == -1)
